  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:42.382407\",\n\t\"name\": \"status-and-distribution-of-marsh-and-sedge-meadow-birds-at-horicon-necedah-and-trempealeau\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study conducted a baseline inventory
  of nongame bird communities and habitat components at wetland types within three
  wildlife refuges in Wisconsin; Horicon, Necedah, and Trempealeau. Baseline data
  are essential to monitor nongame bird population changes in wetland complexes that
  occur within areas such as federal refuges. The primary objectives of this study
  were to: 1) estimate relative abundance of all bird species detected and determine
  density indices for common bird species, 2) calculate species richness and density
  indices for avian communities, and 3) recommend a long-term monitoring strategy
  for surveying and managing avian communities in wetland habitat types within each
  refuge. This study provides a baseline for assessing changes to marsh and sedge
  meadow bird populations. A secondary objective was to describe the dominant habitat
  characteristics at sites surveyed in each refuge for eventual bird-habitat association
  studies.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
